INSERT dbo.AbpLanguageTexts(Id, CreationTime, CreatorUserId, [Key], LanguageName, LastModificationTime, LastModifierUserId, Source, TenantId, Value) VALUES (20627, '2019-04-23 14:04:04.6648015', 31, N'DashboardDemo_Note_Info', N'vi', NULL, NULL, N'gAMSPro', 1, N' Trong bản demo này, bạn có thể sử dụng menu bên trái để kiểm tra ứng dụng. Trang bảng điều khiển này chỉ để minh họa, nhưng tất cả các trang và chức năng khác được triển khai đầy đủ, hoạt động và sẵn sàng để sản xuất. Bạn có thể thêm / áp dụng các yêu cầu nghiệp vụ của mình vào dự án khởi động này (hoặc loại bỏ bất kỳ chức năng nào bạn không cần). Do đó, bạn có thể có được thời gian biểu thị để bắt đầu ngay lập tức các yêu cầu dự án của riêng bạn.')
INSERT dbo.AbpLanguageTexts(Id, CreationTime, CreatorUserId, [Key], LanguageName, LastModificationTime, LastModifierUserId, Source, TenantId, Value) VALUES (20628, '2019-04-23 14:04:04.6648015', 31, N'WelcomePage_Title', N'vi', NULL, NULL, N'gAMSPro', 1, N'Chào mừng bạn!')
